import React from 'react'
import { AppRouter } from './AppRouter'

export const MainApp = () => {
    return (
        <>
            <AppRouter />
            <iframe src="https://discord.com/widget?id=609186963010093066&theme=dark" width="350" height="500" allowtransparency="true" frameborder="0" sandbox="allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts"></iframe>
        </>
    )
}
